import { Segment, Header, Image, Button } from "semantic-ui-react";

function Home() {
  const src =
    "https://res.cloudinary.com/smartrestaurantapi/image/upload/v1629384728/162075162_965618190870570_2873432039017907345_n_hkg18a.jpg";

  return (
    <Segment.Group vertical>
      <Segment inverted>
        <Image src={src} circular size="medium" centered />
        <Header size="medium" textAlign="center">
          I am Juan, a passionate developer who aims to build great applications
          using multiple technologies.
        </Header>
      </Segment>
      <Segment inverted>
        <p className="para">
          Lorem ipsum dolor sit, amet consectetur adipisicing elit. Et quisquam
          voluptate, maxime, minus qui consequatur repudiandae rem voluptatibus
          iusto omnis quis excepturi! Ratione incidunt vero ullam commodi
          maiores? Dolorem, provident.
        </p>
      </Segment>
    </Segment.Group>
  );
}

export default Home;
